import React from "react";
import { ScrollView, View } from "react-native";
import styled from "styled-components/native";
import {
  SafeAreaViewContainer,
  TertiaryButton,
  RightGravity,
  SpacingSmall,
  Subtitle,
  ParentMargin,
} from "../../../components/common.style";

export const TravellerPlanScreen = () => {
  return (
    <SafeAreaViewContainer>
      <ScrollView>
        <H1>Add Room</H1>

        <SpacingLarge />

        <TextInputTheme></TextInputTheme>
        <TextInputTheme></TextInputTheme>


        <ModalView></ModalView>
        <SpacingLarge />

        <PrimaryButton
          icon="plus-circle"
        >
          Add
        </PrimaryButton>
      </ScrollView>
    </SafeAreaViewContainer>
  );
};
